   const [data,setData] = useState(null)
   let title = React.useRef()
   const URL="/alchemy"
   console.log(title.current.innerText)
   useEffect(() => {
      GET(URL).then((response) => {
         setData(response.data)
      })
      },[] )

   return (
      <PageLayout          
      title={
         <>
            <p className='title' ref={title}>Imperial Alchemy</p>
            <p className='description'>Determine imperial delivery profit from various elixirs based on marketplace value or total revenue</p>
         </>
      }

      input={
         <p>Input</p>
      }

      table={
         <p>Table</p>
      }
      />     
   )
}


